import axios from 'axios';

const DEEPSEEK_API_KEY = '40510637-b0b7-4106-a372-acf2983ad03c'; // 替换为实际Key
const API_URL = 'https://ark.cn-beijing.volces.com/api/v3/chat/completions'; // 确认实际API地址

export async function callDoubao(input) {
  try {
    const response = await axios.post(API_URL, {
      model: "doubao-1-5-thinking-vision-pro-250428", // 指定模型
      messages: [
        {
          "content": [
            {
              "text": "图片主要讲了什么?",
              "type": "text"
            },
            {
              "image_url": {
                // "url": "https://ark-project.tos-cn-beijing.ivolces.com/images/view.jpeg"
                "url": input.imageUrl
                // url: '…'
              },
              "type": "image_url"
            }
          ],
          "role": "user"
        }
      ],
      // stream: true,
      // temperature: 0.7, // 控制生成随机性
      // max_tokens: 2000
    }, {
      headers: {
        'Authorization': `Bearer ${DEEPSEEK_API_KEY}`,
        'Content-Type': 'application/json'
      },
    //   responseType: 'stream' // 关键：指定响应类型为流
    });

    console.log(response)
  } catch (error) {
    console.error('API调用失败:', error.response?.data || error?.message);
    throw error;
  }
}

const base64Img = "data:image/png;base64,"

const img1 = "https://ark-project.tos-cn-beijing.volces.com/doc_image/ark_demo_img_1.png"

callDoubao({
    imageUrl: base64Img
})